  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113559 includes chemical,
  discrete sample, physical and profile data collected from JOHAN HJORT in the Barents
  Sea, North Greenland Sea and Norwegian Sea from 1993-07-30 to 1993-08-15 and retrieved
  during cruise CARINA/58JH19930730. These data include ALKALINITY, DISSOLVED INORGANIC
  CARBON, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect
  these data include CTD and bottle. These data were collected by I. Skelvan of Commonwealth
  Scientific and Industrial Research Organization, Truls Johannessen of University
  of Bergen; Bjerknes Center for Climate Research; Geophysical Institute and F. Rey
  [affiliation unknown] as part of the CARINA/58JH19930730 data set.nnThe CARINA (CARbon
  dioxide IN the Atlantic Ocean) data synthesis project is an international collaborative
  effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
